import React, { Fragment } from 'react';

const Profile = ({count, name, username, email, website}) => {
    return(
         <Fragment>
             <li className="list-group-item "><strong >USER ID:</strong> {count}</li>
             <li className="list-group-item"><strong>name:</strong> {name}</li>
             <li className="list-group-item"><strong>username:</strong> {username}</li>
             <li className="list-group-item"><strong>email:</strong> {email}</li>
             <li className="list-group-item"><strong>website:</strong> {website}</li>
         </Fragment>
    )
}

export default Profile;
